// src/pages/AdminDashboard.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="admin-container">
      <div className="navbar">
        <ul>
          <li onClick={() => navigate("/admin-dashboard/accept-users")}>Accept Registration Requests</li>
          <li onClick={() => navigate("/admin-dashboard/accept-posts")}>Accept Post Requests</li>
          <li onClick={() => navigate("/admin-dashboard/available-properties")}>Available Properties</li>
        </ul>
      </div>

      <div className="content">
        <h2>Welcome to the Admin Dashboard</h2>
      </div>
    </div>
  );
};

export default AdminDashboard;
